const getVideoInfo = () => {
  let video_id = "VA770wpLX-Q";
  fetch(
    // "https://noembed.com/embed?callback=example&url=http://www.youtube.com/watch?v=" +
    //   video_id,

    ("http: //noembed.com/embed?url=http%3A//www.youtube.com/watch%3Fv%3"+video_id+"&callback=my_embed_function",
    {
      method: "get",
    })
  )
    .then(function (response) {
      console.log(response);
    })
    .catch(function (err) {
      console.log(err);
    });
};

const Media = () => (
  <div>
    <h1>Youtube Code goes here</h1>
    {getVideoInfo()}
  </div>
);

export default Media;
